// Get unique strike ID const strikeId = strike . id ‚Äã // Buying a call const isCall =  true const isBuy =  true ‚Äã // Buying 1.0 contract (in units of wei) const  ONE_BN  = ethers . constants . WeiPerEther ‚Äã / Allow for  0.1 % slippage const  SLIPPAGE  =  0.001 ‚Äã // Generate trade transaction with quote const trade =  await strike . trade ( account . address , strikeId , isCall , isBuy ,  ONE_BN ,  SLIPPAGE ) ‚Äã // Check if trade is disabled if  ( trade . isDisabled )  {  throw  new  Error ( trade . disabledReason ) } ‚Äã // Sign + send transaction const tradeResponse =  await signer . sendTransaction ( trade . tx ) ‚Äã // Wait for transaction to be confirmed const tradeReceipt =  await tradeResponse . wait () ‚Äã // Get the resulting trade event const tradeEvent =  ( await TradeEvent . getByHash ( lyra , tradeReceipt . transactionHash ))[ 0 ] 5. Adjust Position Using a reference to a position - which can be retrieved from lyra.positions or directly from a TradeEvent per the previous code snippet - we can adjust its size and collateral. In this example we increase the previous position's size from 1.0 to 2.0 contracts using the position.add function. // Get the open position from a trade (can also be fetched from lyra.positions) const position =  await tradeEvent . position () ‚Äã // Adding 1.0 contracts to the position const  ONE_BN  = ethers . constants . WeiPerEther ‚Äã // Maintaining slippage of 0.1% const  SLIPPAGE  =  0.001 ‚Äã // Generate trade transaction with quote const addPosition =  await position . add ( ONE_BN ,  SLIPPAGE ) ‚Äã // Check if trade is disabled if  ( addPosition . isDisabled )  {  throw  new  Error ( addPosition . disabledReason ) } ‚Äã // Sign + send transaction const addPositionResponse =  await signer . sendTransaction ( addPosition . tx ) ‚Äã // Wait for transaction to be confirmed const addPositionReceipt =  await addPositionResponse . wait () ‚Äã // Get the resulting position adjustment event const addPositionEvent =  ( await TradeEvent . getByHash ( lyra , addPositionReceipt . transactionHash ))[ 0 ] 6. Close Position Similarly, to close a position you can simply call position.close from a Position reference. // Maintaining slippage of 0.1% const  SLIPPAGE  =  0.001 ‚Äã // Generate trade transaction with quote const closePosition =  await position . close ( SLIPPAGE ) ‚Äã // Check if trade is disabled if  ( closePosition . isDisabled )  {  throw  new  Error ( addPosition . disabledReason ) } ‚Äã // Sign + send transaction const closePositionResponse =  await signer . sendTransaction ( closePosition . tx ) ‚Äã // Wait for transaction to be confirmed const closePositionReceipt =  await closePositionResponse . wait () ‚Äã // Get the resulting position close event const closePositionEvent =  ( await TradeEvent . getByHash ( lyra , addPositionReceipt . transactionHash ))[ 0 ] Previous Trading Rewards Next Listen to Trades Last modified 4mo ago Copy link On this page 1. Setup Lyra.js 2. Find a Strike 3. Approve sUSD 4. Buy a Call 5. Adjust Position 6. Close Position /$ /$
